import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component {
    constructor(props) {
        super(props);

        this.state = { lat: 0, lon: 0, key: "AIzaSyCwlyN-4mdDsouhSYJaEdX0I-7dfzdytq4"};

        window.navigator.geolocation.getCurrentPosition(
            (position) => {
                console.log(position);
                this.setState({ lat: position.coords.latitude, lon: position.coords.longitude });
                fetch("https://maps.googleapis.com/maps/api/geocode/json?latlng="+this.state.lat+","+this.state.lon+"&key="+this.state.key)
                    .then(function(response) {
                        return response.json();
                    })
                    .then(function(myJson) {
                        console.log(JSON.stringify(myJson));
                    });
            },
            (err) => {
                this.setState({ lat: err.message });
            }
        );
    }

    render() {
        return (
            <div>Latitude: {this.state.lat}</div>
        );
    }
}
ReactDOM.render(<App/>, document.querySelector('#root'));
